import * as React from 'react';

// material-ui
import { Checkbox, CardContent, Divider, FormControlLabel, Grid, Typography, TextField } from '@material-ui/core';
import { connect } from 'react-redux';
import * as actions from 'store/actions';
import { fetchSectionAttributes } from 'store/actions';


import SubCard from 'ui-component/cards/SubCard';


/*
* Component Function
* */
function ClientCaseLoad({ sectionData, groupData }) {
    <Grid container mb={3} spacing={5}>
        <Grid item xs={12}>
            <SubCard title='Client Caseload'>
                <CardContent>
                    <Grid container spacing={3} alignItems='center'>
                        <div>Grid</div>
                    </Grid>
                    <Grid container spacing={3} alignItems='center'>
                        <div>Grid</div>
                    </Grid>
                </CardContent>
            </SubCard>
        </Grid>
    </Grid>;
}

const mapStateToProps = state => ({
    sectionData: state.sectionForm
});

const mapDispatchToProps = dispatch => ({});

export default connect(mapStateToProps, mapDispatchToProps)(ClientCaseLoad);
